import React, { Component } from 'react';
const Navbar = () =>{
	return ( 
		<nav className="navbar">
			<h1> Notarization with Blockchain </h1>
			<div className="links">
				<a href="/"> Home </a>
				<a href="/certify"> Store&Certify </a>
				<a href="/vertify"> Vertify </a>
				<a href="/fetch" style={{
					color:"white",
					backgroundColor:"#f1356d",
					borderRadius:'8px'
				}
				}>Fetch</a>
			</div>
		</nav>
	);
}

export default Navbar;
